import React from "react";

import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import { SYMBOLS } from "../../Constants/Constants";
import useStyles from "../../Pages/SearchDetails/styles";
import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
const History = ({ historyDay, weather, degrees }) => {
  const classes = useStyles();

  console.log(historyDay);
  return (
    <>
      <Grid container direction="row" justify="space-around">
        <Grid item md={1} xs={6}>
          <Box>
            <img
              className={classes.media}
              // src={historyDay.day.condition.icon}
              alt="weather"
            ></img>
          </Box>
        </Grid>
        <Grid item md={2} xs={6}>
          <Typography className={classes.degrees}>
            {degrees
              ? historyDay.day.avgtemp_c + SYMBOLS.DEGREES
              : historyDay.day.avgtemp_f + SYMBOLS.FAHRENHEIT}
          </Typography>
          <Typography className={classes.condition}>
            {historyDay.day.condition.text}
          </Typography>
        </Grid>

        <Grid item md={6} xs={12}>
          <Card className={classes.root} raised>
            <CardContent>
              <Box mb={2} ml={4}>
                <Grid container spacing={2}>
                  <Grid item xs={4}>
                    <Typography className={classes.subTitle}>
                      {degrees
                        ? historyDay.day.mintemp_c + SYMBOLS.DEGREES
                        : historyDay.day.mintemp_f + SYMBOLS.FAHRENHEIT}
                    </Typography>
                    <Typography className={classes.subText}>Low</Typography>
                  </Grid>
                  <Grid item xs={4}>
                    <Typography className={classes.subTitle}>
                      {degrees
                        ? historyDay.day.maxwind_mph + " mph"
                        : historyDay.day.maxwind_kph + " kph"}
                    </Typography>
                    <Typography className={classes.subText}>Wind</Typography>
                  </Grid>
                  <Grid item xs={4}>
                    <Typography className={classes.subTitle}>
                      {historyDay.astro.sunrise}
                    </Typography>
                    <Typography className={classes.subText}>Sunrise</Typography>
                  </Grid>
                </Grid>
              </Box>

              <Box ml={4}>
                <Grid container spacing={2}>
                  <Grid item xs={4}>
                    <Typography className={classes.subTitle}>
                      {historyDay.day.maxtemp_c} {SYMBOLS.DEGREES}
                    </Typography>
                    <Typography className={classes.subText}>High</Typography>
                  </Grid>
                  <Grid item xs={4}>
                    <Typography className={classes.subTitle}>
                      {historyDay.day.daily_will_it_rain === 1 ? "Yes" : "No"}
                    </Typography>
                    <Typography className={classes.subText}>Rain</Typography>
                  </Grid>
                  <Grid item xs={4}>
                    <Typography className={classes.subTitle}>
                      {historyDay.astro.sunset}
                    </Typography>
                    <Typography className={classes.subText}>Sunset</Typography>
                  </Grid>
                </Grid>
              </Box>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </>
  );
};

export default History;
